import axios from "axios"
import { publicRequest } from "../axios"
import {storeAdmin} from "./adminRedux"

export const createAdmin = async (adminObj, img,dispatch) =>{
    try {
            const res = await axios.post("http://localhost:5000/api/admin/create", {...adminObj,img})
            console.log("post sent")
            console.log(res.data)
            dispatch(storeAdmin(res.data))
    } catch {
        console.log("couldnt create admin")
    }  
}
